import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // Tailwind CSS
import './styles/reset.css'; // Other CSS files
import './styles/bootstrap.css';
import './styles/font-awesome.css';
import './styles/owl.carousel.css';
import './styles/owl.theme.default.css';
import './styles/jquery.fancybox.css';
import './fonts/fi/flaticon.css';
import './styles/flexslider.css';
import './styles/main.css';
import './styles/indent.css';
import './rs-plugin/css/settings.css';
import './rs-plugin/css/layers.css';
import './rs-plugin/css/navigation.css';
import './tuner/css/colorpicker.css';
import './tuner/css/styles.css';
import App from './App';

// import './index.css'; // Optional: your global styles

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
